import './App.css';
import Top from "./myComponent/Top";
import BlankTextImage from "./myComponent/BlankTextImage";
import UlFlexImg from "./myComponent/UlFlex";
import UlFlexImgText from "./myComponent/UlFlexImgText";
import Footer from "./myComponent/Footer";
import image from "./image";
let logoUlimg1 = [
    image.logoUl1,
    image.logoUl2,
    image.logoUl3,
    image.logoUl4
]
let logoUlimg2 = [
    image.logoUl11,
    image.logoUl12,
    image.logoUl13,
    image.logoUl14,
    image.logoUl15
]

function App() {
  return (
    <div className="App">
        <Top />



        <BlankTextImage
            dark={true}

            imgButton2={image.playIcon}
            topText={"Next genaretion platform"}
            h1Text={"Artificial intelligence & Syber security"}
            mainText={"Lorem ipsum is placeholder text commonly " +
                "used in the graphic, print, and publishing " +
                "industries for previewing layouts and visual mockups."}
            button={2}
            button1={"Get Started"}
            button2={"Watch Video"}
        />
        <UlFlexImg
            count={4}
            img={logoUlimg1}
            backgroundColor={'#0d1a2c'}

        />
        <BlankTextImage
            reverse={true}
            dark={false}
            img={image.brain}
            h1Text={"Apply AI, Deep Learning and Data Sciece to solve"}
            mainText={"Lorem ipsum is placeholder text commonly " +
                "used in the graphic, print, and publishing " +
                "industries for previewing layouts and visual mockups."}
            button={1}
            button1={"Learn More"}
        />
        <UlFlexImgText
            count={5}
            img={logoUlimg2}
            backgroundColor={"#070e17"}
            h1Text1={"Naxly as the Winners in Global Agency Awards"}
            text1={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text2={"Expert respective Agency Awards"}
            text2={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text3={"Business respective Global Agency Awards"}
            text3={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text4={"Value for Results in Global Agency Awards"}
            text4={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}

            h1Text5={"Global Experience in Agency Awards"}
            text5={"Lorem ipsum is placeholder text commonly used in print, and publishing industries for previewing layouts and visual mockups."}
        />
        <BlankTextImage
            dark={false}
            img={image.smartphone}
            h1Text={"What our clients say about our awesome solutions"}
            mainText={"To take a trivial example, which of us ever" +
                " undertakes laborious physical exercise, except to" +
                " obtain some advantage from it who do not know." +
                "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "Lorem ipsum is placeholder text commonly used in " +
                "the graphic, print, and publishing." +
                "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "Lorem ipsum is placeholder previewing layouts and " +
                "visual mockups." + "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "ㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤㅤ" +
                "Lorem ipsum is placeholder text" +
                " commonly used in the graphic, print, and publishing" +
                " industries for previewing layouts and visual mockups."


            }
        />
        <Footer
            dark={true}

        />
    </div>
  );
}

export default App;

